const vKeyNames = [];
const vKeyPositions = [];

const CORSAIR_LIGHTING_CONTROLLER_STREAM    = 0x32;
const CORSAIR_LIGHTING_CONTROLLER_COMMIT    = 0x33;
const CORSAIR_LIGHTING_CONTROLLER_START     = 0x34;
const CORSAIR_LIGHTING_CONTROLLER_RESET     = 0x37;
const CORSAIR_LIGHTING_CONTROLLER_MODE      = 0x38;

const CORSAIR_HARDWARE_MODE = 0x01;
const CORSAIR_SOFTWARE_MODE = 0x02;
export function SubdeviceController(){ return true; }
const DeviceMaxLedLimit = 204;
let ChannelRGBOrder = [];
export function LacksOnBoardLeds(){ return true;}
export function DefaultComponentBrand() { return "Corsair";}
export function Documentation(){ return "troubleshooting/corsair"; }

//Channel Name, Led Limit
let ChannelArray = [
	["Channel 1", 204],
	["Channel 2", 204],
];

export function onCh1RGBConfigChanged(){ getRGBOrder(); }
export function onCh2RGBConfigChanged(){ getRGBOrder(); }

function getRGBOrder()
{
	ChannelRGBOrder = [ Ch1RGBConfig, Ch2RGBConfig ];
}

function SetupChannels(){
	device.SetLedLimit(DeviceMaxLedLimit);

	for(let i = 0; i < ChannelArray.length; i++){
		device.addChannel(ChannelArray[i][0], ChannelArray[i][1]);
	}
}

export function Initialize() {
	SetupChannels();
	getRGBOrder();
}

export function Shutdown() {
	//channel 0
	let packet = [0x00, CORSAIR_LIGHTING_CONTROLLER_MODE, 0x00, CORSAIR_HARDWARE_MODE];
	device.write(packet, 65);
	//channel 1
	packet = [0x00, CORSAIR_LIGHTING_CONTROLLER_MODE, 0x01, CORSAIR_HARDWARE_MODE];
	device.write(packet, 65);
}

export function LedNames() {
	return vKeyNames;
}


export function LedPositions() {
	return vKeyPositions;
}


function SendChannel(Channel) {
  let ChannelLedCount = device.channel(ChannelArray[Channel][0]).LedCount();
  const componentChannel = device.channel(ChannelArray[Channel][0]);

  let ColorData = [];

  if(LightingMode === "Forced") {
    ColorData = device.createColorArray(forcedColor, ChannelLedCount, "Seperate");

  } else if(componentChannel.shouldPulseColors()) {
    ChannelLedCount = 40;

    const pulseColor = device.getChannelPulseColor(ChannelArray[Channel][0], ChannelLedCount);
    ColorData = device.createColorArray(pulseColor, ChannelLedCount, "Seperate");

  } else {
    ColorData = device.channel(ChannelArray[Channel][0]).getColors("Seperate");
  }

  const RedChannelData = ColorData[0];
  const GreenChannelData = ColorData[1];
  const BlueChannelData = ColorData[2];

  //Why do I make it so convoluted hahahaha
  let rgbOrder;
  switch (ChannelRGBOrder[Channel]) {
    case "RGB":
      rgbOrder = [RedChannelData, GreenChannelData, BlueChannelData];
      break;
    case "RBG":
      rgbOrder = [RedChannelData, BlueChannelData, GreenChannelData];
      break;
    case "GRB":
      rgbOrder = [GreenChannelData, RedChannelData, BlueChannelData];
      break;
    case "GBR":
      rgbOrder = [GreenChannelData, BlueChannelData, RedChannelData];
      break;
    case "BRG":
      rgbOrder = [BlueChannelData, RedChannelData, GreenChannelData];
      break;
    case "BGR":
      rgbOrder = [BlueChannelData, GreenChannelData, RedChannelData];
      break;
    default:
      rgbOrder = [RedChannelData, GreenChannelData, BlueChannelData];
  }

  // Set up for update
  InitChannel(Channel);

  // Stream RGB Data
  let ledsSent = 0;
  ChannelLedCount = ChannelLedCount >= 40 ? 40 : ChannelLedCount;

  while(ChannelLedCount > 0) {
    const ledsToSend = ChannelLedCount >= 50 ? 50 : ChannelLedCount;

    StreamLightingPacketChanneled(ledsSent, ledsToSend, 0, rgbOrder[0].splice(0, ledsToSend), Channel);

    StreamLightingPacketChanneled(ledsSent, ledsToSend, 1, rgbOrder[1].splice(0, ledsToSend), Channel);

    StreamLightingPacketChanneled(ledsSent, ledsToSend, 2, rgbOrder[2].splice(0, ledsToSend), Channel);

    ledsSent += ledsToSend;
    ChannelLedCount -= ledsToSend;
  }
}


export function Render() {
	SendChannel(0);
	device.pause(1);

	SendChannel(1);
	device.pause(1);

	SubmitLightingColors();

}


function InitChannel(channel){
	let packet = [0x00, CORSAIR_LIGHTING_CONTROLLER_MODE, channel, CORSAIR_SOFTWARE_MODE];

	device.write(packet, 65);
	device.read(packet, 17);

}

function StreamLightingPacketChanneled(start, count, colorChannel, data, channel) {
	//channel selection == 32 0/1 Start Count Channel LEDS
	//(Start, Count, Color, Data)
	let packet = [0x00, CORSAIR_LIGHTING_CONTROLLER_STREAM, channel, start, count, colorChannel];
	packet = packet.concat(data);

	device.write(packet, 65);
	device.read(packet, 17);
}

function channelStart(channel){
	//start packet == 34 00 channel (len 64)
	let packet = [0x00, CORSAIR_LIGHTING_CONTROLLER_START, channel];

	device.write(packet, 65);
	device.read(packet, 17);
}

function channelReset(channel){
	let packet = [0x00, CORSAIR_LIGHTING_CONTROLLER_RESET, channel];

	device.write(packet, 65);
	device.read(packet, 17);
}


function SubmitLightingColors() {
	let packet = [0x00, CORSAIR_LIGHTING_CONTROLLER_COMMIT, 0xFF];

	device.write(packet, 65);
	device.read(packet, 17);
}


export function Validate(endpoint) {
	return endpoint.interface === -1 | 2;
}

